import React, { Component } from "react";

class Home extends Component {
  render() {
    return (
      <section id="Home" className="py-10 px-3 bg-amber-300 h-screen">
        <div className="bg-gray-700 px-8 rounded-2xl py-5 lg:max-w-4xl mx-auto min-h-[24rem] mt-20 flex gap-6 lg:flex-row flex-col-reverse items-center">
          <div className="flex flex-col justify-center items-center w-full">
          <img src="./images/loeffa.png" alt="" className="p-2" />
            <h2 className="text-2xl font-semibold text-white mt-10">
              Aplicativo de Reservas
            </h2>
            <div className="flex flex-row p-10 gap-20">
            <button className="bg-transparent hover:bg-blue-500 text-blue-700 font-semibold hover:text-red-500 py-2 px-4 border border-blue-500 hover:border-transparent rounded">Reservar</button>
            <button className="bg-transparent hover:bg-blue-500 text-blue-700 font-semibold hover:text-white py-2 px-4 border border-blue-500 hover:border-transparent rounded">Reservas</button>
            </div>
            <button class="relative inline-flex items-center justify-center p-0.5 mb-2 mr-2 overflow-hidden text-sm font-medium text-gray-900 rounded-lg group bg-gradient-to-br from-purple-600 to-blue-500 group-hover:from-purple-600 group-hover:to-blue-500 hover:text-white dark:text-white focus:ring-4 focus:outline-none focus:ring-blue-300 dark:focus:ring-blue-800">
  <span class="relative px-5 py-2.5 transition-all ease-in duration-75 bg-white dark:bg-gray-900 rounded-md group-hover:bg-opacity-0">
      Purple to blue
  </span>
</button>
            
          </div>
          
        </div>
      </section>
    );
  }
}

export default Home;
